script: |
  super -f text -I q8804.spq | sort > q8804.out

inputs:
  - name: q8804.spq
    data: |
      SELECT - col2 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col1 + + 4 BETWEEN - 55 + + 35 * + 83 AND + - 66;
  - name: tab0

outputs:
  - name: q8804.out
    data: |
      -10
      -47
      -99
